function startSearchFromHome(term){
    let form = $('form')[1];
    let inputText = form.children[0];

    inputText.value = term;
    inputText.dispatchEvent(new Event('keydown', { 'bubbles': true }));
    inputText.dispatchEvent(new Event('keyup', { 'bubbles': true }));
    form.submit();
};

